void SwitchMap(int map){
    switch(map){
        case 0:
            OverWorldMapWidth = 80;
            OverWorldMapHeight = 41;
            TileSet = 0;
            BackgroundColor = SKYBLUE;
            break;
        case 1:
            OverWorldMapWidth = 27;
            OverWorldMapHeight = 30;
            TileSet = 1;
            BackgroundColor = BLACK;
            break;
    }
    for (int i = 0; i < 3280; i++){
        switch (map){
            case 0:BigOverWorldMap[i] = OverworldMap[i];break;
            case 1:BigOverWorldMap[i] = InteriorMap[i];break;
        }
    }
}